import 'bootstrap-4-react';
import './main/main.css';
import React from 'react';

import Header from './header/header';
import Content from './content/content';
import Footer from './footer/footer';

function App() {
  return (
    <>
      <header>
        <ul>
          <li className="logo">
              <img src={Logo} style={{
                  marginRight: "10px",
              }} />
              <h2>Gyber.org</h2>
          </li>
          <li>
              <ul className="d-flex space-between list">
                  <li>Home</li>
                  <li>Philosophy</li>
                  <li>Lite Paper</li>
              </ul>
          </li>
          <li>
              <button className="rgbBtn">Private sale</button>
          </li>
        </ul>
      </header>
      <main>
        <div className='container'>
          <Content name="home"/>
        </div>
      </main>
      <footer>
        <Footer/>
      </footer>
    </>
  );
}

export default App;
